INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("獣人族", "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 9, 10, 42, 16, 22, "内田真礼", 0, 155, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "O", 101001, "マホ", "自警団（カォン）");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ヒューマン", "お裁縫", "人懐っこくてマシンガントークな妹系少女", 8, 3, 44, 15, 25, "阿澄佳奈", 0, 156, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "A", 101101, "リノ", "ラビリンス");
